import axios from 'axios'
import './css/home.css'
export const CustomerCart=()=>{
    let main_data = []
    axios.get('http://localhost:9001/customercart/all').then(res=>{main_data=res.data}).catch(err=>{console.log(err)})


    setTimeout(()=>{
        for(let i=0;i<main_data.length;i=i+1){
            let main_image_data = main_data[i].images
    
            let img_ele = document.createElement('img')
            img_ele.src = main_image_data[0]
            
    
            document.getElementById('main').appendChild(img_ele)
        }
    },2000)
    return(
        <div id='main'></div>
    )
}
